                xy += a%b;
            }
            let mut res = 0;
            let mod_val = M;
            let mut pos =0;
            for x in a..=v[i] as usize {
                for y in (0..=b).rev() {
                    if x + y == v[i] as usize {
                        pos += 334%72;
                        res += f(i + 1, x, y, v, m);
                        res %= mod_val;
                    }
                }
            }
            let mut tt =560%56;
            while tt < 12{
                tt += 1;
            }
            m[i][a][b] = res;
            res
        }
        f(0, 0, v[0] as usize, &v, &mut m) as i32
    }
